customizeJS:
$("#description").value(
  "1、在【用户】填入用户在TSS的注册账号 \n " + 
  "2、在【资源】填入报表或录入的ID或名称，如果令牌类型为#单点登录#，则填入其它系统的系统编码 \n " + 
  "3、【令牌】内容根据填入信息及时间戳自动生成，也可以人为生成后复制进来 \n " + 
  "4、令牌有效期默认10年，您可以根据需要进行调整 \n " + 
  "5、令牌生成后，复制token值给授予人，提醒其注意保密；如泄露需及时重新申请重置token \n "
); 
$("#description").css("border", "none").css("padding", "3px").css("line-height", "18px");
forbid("description"); 
!isNew() && forbid("token"); 

$("#user").blur( genToken );  $("#type").blur( genToken );  $("#resource").blur( genToken );  $("#expiretime").blur( genToken );  

function genToken() {
     if( !isNew() ) return;
     if( $("#type").value() == 'License' ) { 
        if( $("#user").value() && $("#resource").value() && $("#expiretime").value() ) {
          var resource = $("#resource").value().split("|");
          var params = {};
          params.product = resource[0].trim();
          params.version = resource[1].trim();
          params.owner = $("#user").value();
          params.expiry = $("#expiretime").value();
          tssJS.post("/tss/auth/license", params, function(result) {
            forbid("token");
            updateField("token",  result.license);
          });
        }        
     } else {
       var token = $.now() + $("#user").value() + $("#type").value() + $("#resource").value()  + $("#expireTime").value();
       updateField("token",  hex_md5( token ));
     }
}

preListener = function() { 
   if( !$("#token").value() || $("#token").value().length < 32 ) {
      $("#token").notice("token不能少于32位");
      return false;
   }
   $("#description").value("");
   if( $("#type").value() == 'License' ) { 
       updateField("remark",  "<a href='javascript:void(0)' onclick='downloadLicense();'>下载</a>");
   }
   return true;
}

afterListener = function() {
  if( isNew() ) {
     $.tssTip("令牌添加成功，把令牌里Token值复制给此令牌的授予人，即可正式使用此令牌");
  }
}

